                        case 'controllers':
                            return (
                                <Controllers/>
                            )
                        case 'synthetise':
                            return (
                                <Synthetise/>
                            )
                        default:
                            return (
                                <LandingPage/>
                            )
                    }
                })()}
            </div>
        </SocketProvider>
    );
}
